sourcesContent:
export const LOGIN_URL = '/v1/user/login';
/**登录请求的数据结构 */
export interface LoginReq {
  email: string;
  password: string;
  client?: string;
}
/**登录响应的数据结构 */
export interface LoginResp {
  id: number;
  name: string;
  avatar: string;
  lever: number;
  email: string;
  level: number;
  token: string;
  freshToken: string;
  cashBack: number;
  createTime: string;
  isFirstRecharge: number;
  pixelId?: string;
  /**经验，接口要确定一下是不是没有 */
  exp: number;
  oldUserExpireTime?: string;
}

export const REGITER_URL = '/v1/user/register';
/**登录请求的数据结构 */
export interface RegiterReq {
  type: number;
  email: string;
  password: string;
  avatar: string;
  country: string;
  referee?: string;
  code?: string;
  pixelId?: string;
  //渠道
  channel?: string;
}

export const GETUSER_URL = '/v1/user/getUserInformation';

interface Game {
  id: number;
  name: string;
  categoryId: number;
  groupId: number;
  icon: string;
  image: string;
  description: string;
  provider: string;
  prizePool: number;
  profit: number;
  fullScreen: number;
  statistic: number;
  sign: number;
  enable: number;
  minCurrency: number;
  maxCurrency: number;
}

interface User {
  id: number;
  name: string;
  avatar: string;
  level: number;
  exp: number;
  email: string;
}

export interface GetUserResp {
  userStatistics: any;
  game: Game[];
  user: User;
}

export const GAME_CATEGORY_URL = '/v1/game/getGameCategory';
export interface getGameCategoryResp {
  id: number;
  name: string;
  image: string;
  description: string;
}

//充值前获取货币
export const GET_CURRENCY_ANDNETWORK = '/v1/global/getCurrencyAndNetwork';
export interface CryptoNetwork {
  id: number;
  icon: string;
  name: string;
  logo: string;
  logo2: string;
}

export interface CryptoCurrency {
  id: number;
  brief: string;
  icon: string;
  name: string;
  logo: string;
  usdtRate: number;
}

export interface getCurrencyAndNetworkResp {
  cryptoNetworks: CryptoNetwork[];
  cryptoCurrencies: CryptoCurrency[];
}

//获取分组
export const GET_GAME_GROUP = '/v1/game/getGameGroup';
export interface getGameGroupResp {
  id: number;
  name: string;
  categoryId: string;
  icon: string;
  logo: string;
  description: string;
  extra: string;
  total: number;
}

//游戏记录
export const GET_ALL_GAME_RECORD = '/v1/global/getAllGameRecord';

export interface GetAllGameRecordReq {
  gameId?: number;
  limit?: number;
  historyId?: number;
  order?: string;
}
export interface GetAllGameRecordResp {
  id: number;
  username?: string;
  avatar?: string;
  level?: number;
  gameName: string;
  createTime: string;
  gameIcon: string;
  chip: number;
  rate: number;
  win: number;
  currencyId: number;
  currencyIcon: string;
}

//广告
export const GET_ADVERTISE_HOME = '/v1/advertise/getAdvertise?module=10';
export const GET_ADVERTISE_GAMES = '/v1/advertise/getAdvertise?module=20';
export interface GetAdvertiseResp {
  id: number;
  module: string;
  image: string;
  cmd: string;
  startTime: string;
  endTime: string;
}

//获取游戏
export const GET_GAMES = '/v1/global/getGames';
export interface GetGamesReq {
  groupId: number;
  pageSize: number;
  pageNumber: number;
  categoryId?: number;
}
export interface GamesDatas {
  id: number;
  name: string;
  categoryId: number;
  groupId: number;
  icon: string;
  image: string;
  description: string;
  provider: string;
  prizePool: number;
  fullScreen: number;
  statistic: number;
  sign: number;
  minCurrency: number;
  maxCurrency: number;
  gameUrl: string;
  cmd: string;
  type: number;
}
export interface GetGamesResp {
  pages: number;
  total: number;
  pageNum: number;
  data: GamesDatas[];
}

//推荐
export const MY_REFEREE = '/v1/referee/myReferee';
export interface RefereeData {
  name: string;
  avatar: string;
  level: number;
}
export interface RewardHistoryData {
  type: number;
  change: number;
  time: string;
}
export interface MyRefereeResq {
  sumBonus: number;
  refereeCount: number;
  myReferee: RefereeData[];
  rewardRecord: null;
  myRewardHistory: RewardHistoryData[];
}

//获取游戏根据id
export const GET_GAMES_BY_ID = '/v1/global/getGameById';
export interface getGameByIdReq {
  gameIds: number[];
  pageNum: number;
  pageSize: number;
}

//查询游戏
export const SELECT_GAME = '/v1/global/selectGame';

export interface selectGame {
  gameIds: number[];
}

//获取实时奖励
export const GET_ENFORCE_REWARDS = '/v1/global/getEnforceRewards';

export interface GetEnforceRewardsResq {
  name: string;
  avatar: string;
  change: number;
}
//排行榜
export const GAME_LEADERBOARD = '/v1/global/getGameWinRank';

export interface GameLeaderboardResq {
  name: string;
  avatar: string;
  level: number;
  win: number;
}

//忘记密码
export const FORGET_PASSWORD = '/v1/user/forgetPassword';
export interface ForgetPasswordReq {
  email: string;
  code: string;
  newPassword: string;
}

//发送邮件测试
export const GET_CODE = '/v1/global/getCode';

//我的推荐
export const GET_REFEREE = '/v1/referee/getUserReferee';
export interface getRefereeData {
  avatar: string;
  betCount: number;
  createTime: string;
  id: number;
  level: string;
  name: string;
  rechargeCount: number;
}
export interface getRefereeItem {
  date: string;
  id: number;
  userId: number;
  refereeId: number;
  exp: number;
  username: string;
  value: number;
  directBet: number;
  teamBet: number;
  level: number;
}
export interface getRefereeResq {
  pageNum: number;
  pages: number;
  total: number;
  data: getRefereeItem[];
}

//最近常玩游戏
export interface RecentGamesResq {
  game: GetGamesResp;
}

//Meta Pixel事件
export const META_PIXEL_EVENT = 'https://www.facebook.com/tr';

//手机注册
export const REGISTER_BY_PHONE = '/v1/user/registerByPhone';
export interface RegisterByPhoneReq {
  type: number;
  phone: string;
  phonePassword: string;
  avatar: string;
  country: string;
  referee?: string;
  code?: string;
  channel?: string;
  pixelId?: string;
}
//手机登陆
export const LOGIN_BY_PHONE = '/v1/user/loginByPhone';
export interface LoginByPhoneReq {
  phone: string;
  phonePassword: string;
  client?: string;
}

//获取月排行
export const GET_MONTH_RANK = '/v1/global/getMonthRank';
export interface GetMonthRankResq {
  userId: number;
  amount: number;
  avatar: string;
  name: string;
}

//获取未上报事件
export const GET_EVENT_REPORT = '/pay/v1/getEventReport';
export interface getEventReportResq {
  id: number;
  isReport: number;
  isFirst: number;
  amount: number;
  currency: string;
}
//处理上报事件
export const UPDATE_EVENT_REPORT = '/pay/v1/updateEventReport';

export interface Pagination<T> {
  pages: number;
  total: number;
  pageNum: number;
  data: T[];
}
/**
 * 推荐与返佣
 * 查询转出记录
 */
export const GET_OUT_RECORD = '/v1/referee/getOutRecord';
export interface OutRecordReq {
  pageSize: number;
  pageNumber: number;
}
export interface OutRecordItem {
  id: number;
  userId: number;
  type: number;
  change: number;
  status: number;
  time: string;
  reason: string;
}
export type OutRecordResp = Pagination<OutRecordItem>;

/**
 * 推荐与返佣
 * 获取推荐人信息
 */
export const GET_USER_REFEREELNFO = '/v1/referee/getUserRefereeInfo';
export interface UserRefereeInfoResp {
  todayRegister: number;
  todayRecharge: number;
  totalRegister: number;
  totalRecharge: number;
  totalExp: string;
  todayExp: string;
  totalIn: string;
  totalOut: number;
  currentAmount: number;
  todayIn: string;
  level: number;
  isNetWorkRed: number;
}

/**
 * 推荐与返佣
 * 获取排行榜
 */
export const GET_DAYRANK = '/v1/referee/getDayRank';
export interface DayRankResp {
  name: string;
  avatar: string;
  amount: number;
}

/**
 * 推荐与返佣
 * 获取用户推荐报告
 */
export const GET_USER_REPORT = '/v1/referee/getUserReport';
export interface UserReportItem {
  id: number;
  date: string;
  userId: number;
  referee1Exp: number;
  referee2Exp: number;
  referee3Exp: number;
  firstProportion: number;
  twoProportion: number;
  thirdProportion: number;
  refereeLevel: number;
  total_exp: number;
  registerCount: number;
  level: number;
  amount: number;
}
export type UserReportResp = Pagination<UserReportItem>;

/**
 * 推荐返佣
 * 提现到钱包
 */
export const TRANSFER = '/v1/referee/transferRefereeToBalance';
export interface TransferReq {
  amount: number;
}

/**
 * 获取令牌
 */
export const GOOGLE_TOKEN = 'https://oauth2.googleapis.com/token';
export interface GoogleTokenReq {
  client_id: string;
  client_secret: string;
  redirect_uri: string;
  code: string;
  grant_type?: 'authorization_code';
}
/**
 * 三方登陆
 */
export const THIRD_LOGIN = '/v1/thirdLogin/login';
/**登录请求的数据结构 */
export interface ThirdLoginReq {
  type: string;
  code: string;
  avatar: string;
  country: string;
  referee?: string;
  pixelId?: string;
  //渠道
  channel?: string;
  //类型
  loginType?: string;
}
// pg登陆
export const PG_LOGIN_GAME = '/v1/pg/loginGame';

/**
 * 获取网红帐号佣金
 */
export const GET_NETWORK_REFEREEINFO = '/v1/referee/getNetworkRefereeInfo';
export interface NetworkRefereeInfo {
  pages: number;
  total: number;
  pageNum: number;
  data: NetworkRefereeData[];
}

export interface NetworkRefereeData {
  userId: number;
  createTime: string;
  totalRechargeAmount: number;
}

export interface GetNetworkRefereeInfoResp {
  netWorkRefereeInfoMyPage: NetworkRefereeInfo;
  totalRechargeAmount: number;
  totalRechargePeople: number;
}

/**
 * 获取pp游戏链接
 */
export const PP_LOGIN_GAME = '/v1/pp/loginGame';

//获取用用户好友领取情况
export const GET_FRIEND_RECEIVE_HISTORY =
  '/v1/popularize//v1/getFriendReceiveHistory';
export interface GetFriendReceiveHistoryResp {
  phone?: string;
  email?: string;
  count: number;
}

//获取游戏接口（聚合，自研pg，官方pg,pp）
export const GAME_LOGIN = '/playGame/v1/gameLogin';
export interface GameLoginResp {
  msg: string;
  type: number;
}
